INSERT INTO `courses` VALUES (8,'Math, Language Arts & Science',2,3,'<p style=\"text-align: center;\">Thrive is a great transition from the Enhance program once your child has adapted to&nbsp; the remote learning experience.</p>\r\n<p style=\"text-align: center;\">Teachers and Parents have identified the ideal learning level for the student to excel upto 80% growth percentile relative to their peers outside the PILLARZ experience.</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Student Assessment</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Class Outline</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Homework &amp; Materials</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Parent Weekly Report</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Parent Audio/Video Record</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Parent-Teacher Weekly Consultation</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Virtual Events</p>',199,599,'2020-05-27 06:41:00.753197','2020-08-13 12:39:23.225918',5,1,'2 Hours / 3 Days per Week',0),(9,'Math & Language Arts',1,6,'<p style=\"text-align: center;\">Enhance is an excellent program for parents that want their child to refresh and enhance their language and math skills.</p>\r\n<p style=\"text-align: center;\">The Enhance program provides the student an opportunity to become familiar with video conferencing learning.</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Student Assessment</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Class Outline</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Homework and Materials</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Parent Weekly Report</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Parent Audio/Video Record</p>',99,299,'2020-05-27 06:43:27.884004','2020-08-13 12:39:00.155725',4,1,'2 Hours / 2 Days per Week',0),(10,'Math, Language Arts, Science and Social Studies',12,5,'<p style=\"text-align: center;\">Scholar brings all four areas of study into a four day per week, half-day sessions.</p>\r\n<p style=\"text-align: center;\">PILLARZ&nbsp; Teachers are rotated based on specialty, and class interventions are planned to optimize the student\'s learning experience and excel up to 90% growth percentile of their peers.</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Student Assessment</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Class Outline</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Homework &amp; Materials</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Parent Weekly Report</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Parent Audio/Video Record</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Parent Teacher Weekly Consultation</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Weekly Individual Learning</p>\r\n<p style=\"text-align: center;\"><span style=\"background-color: #ffffff; color: #222222; font-family: arial, sans-serif; font-size: 14px;\">&bull; </span>Guest Speakers and Virtual Events</p>',399,999,'2020-05-27 06:43:27.929817','2020-08-13 12:38:27.284702',6,1,'3 Hours / 4 Days per Week',0),(20,'K-8 Math Assessment',NULL,NULL,'<p>This is a Free Grade Assessment. no Obligation</p>',0,0,'2020-08-27 01:51:47.929670','2020-09-03 15:30:14.206118',4,0,'2 Hours',0),(21,'Language Arts Assessment',NULL,NULL,'<p>This is a Free Language Arts Assement with no obligation</p>',0,0,'2020-08-27 01:54:10.338119','2020-09-03 15:30:15.044572',4,0,'Two Hours',0);
